⚠️ IMPORTANT Famiq is built on top Bevy and relies entirely on its ECS architecture . When you use Famiq , you're actually using the Bevy engine , with Famiq providing an abstraction for its UI system to help you build GUI applications, rather than Game UI. A solid understanding of Bevy's ECS is required. If you're new to Bevy , I recommend checking out Bevy's quick start guide . use bevy::prelude::*;
use famiq::prelude::*; fn main() { App::new() .add_plugins(DefaultPlugins) .add_plugins(FamiqPlugin) // required by Famiq .add_systems(Startup, setup_ui) .run();
} fn setup_ui( mut commands: Commands, mut famiq_res: ResMut<FamiqResource>, asset_server: Res<AssetServer>
) { commands.spawn(Camera2d::default()); // create a builder let mut builder = FamiqBuilder::new(&mut commands, &mut famiq_res, &asset_server); // simple text & button widgets let text = fa_text(&mut builder, "Hello world").build(); let button = fa_button(&mut builder, "Press me").build(); // add widgets to a container fa_container(&mut builder).children([text, button]).build();
} run your project cargo run, you will see a text and a button.

